import React from 'react';
import '../components/Navbar.js';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div>
        <h1 className="navbar-title">Wathare Infotech Solutions</h1>
      </div>
    </nav>
  );
};

export default Navbar;
